import React from 'react';

interface StudentListProps {
    students: any[];
    onDelete: (studentId: string) => void;
    onEdit: (studentId: string) => void;
}

const StudentList: React.FC<StudentListProps> = ({ students, onDelete, onEdit }) => {
    // Lógica para renderizar la lista de estudiantes
    return (
        <div>
            {students.map(student => (
                <div key={student.id}>
                    <span>{student.name}</span>
                    <button onClick={() => onDelete(student.id)}>Eliminar</button>
                    <button onClick={() => onEdit(student.id)}>Editar</button>
                </div>
            ))}
        </div>
    );
};

export default StudentList;
